import React from 'react';
import {
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Button,
  Typography,
  Box,
} from '@mui/material';
import { styled } from '@mui/material/styles';
import DownloadIcon from '@mui/icons-material/Download';
import MovieIcon from '@mui/icons-material/Movie';
import AudiotrackIcon from '@mui/icons-material/Audiotrack';
import HighQualityIcon from '@mui/icons-material/HighQuality';
import { formatFileSize } from '../utils/format';

const GlassTableContainer = styled(TableContainer)({
  background: 'rgba(26, 26, 46, 0.6)',
  backdropFilter: 'blur(10px)',
  borderRadius: '15px',
  border: '1px solid rgba(255, 255, 255, 0.1)',
  boxShadow: '0 8px 32px 0 rgba(0, 0, 0, 0.37)',
  overflow: 'hidden',
});

const StyledTable = styled(Table)({
  '& .MuiTableCell-root': {
    borderColor: 'rgba(255, 255, 255, 0.1)',
    color: 'white',
  },
  '& .MuiTableHead-root .MuiTableCell-root': {
    background: 'rgba(255, 255, 255, 0.05)',
    fontWeight: 'bold',
  },
  '& .MuiTableRow-root:hover': {
    background: 'rgba(255, 255, 255, 0.05)',
  },
});

const DownloadButton = styled(Button)({
  background: 'linear-gradient(45deg, #ff0000 30%, #ff4b2b 90%)',
  color: 'white',
  padding: '8px 20px',
  borderRadius: '25px',
  textTransform: 'none',
  boxShadow: '0 3px 15px rgba(255, 0, 0, 0.2)',
  '&:hover': {
    background: 'linear-gradient(45deg, #ff4b2b 30%, #ff0000 90%)',
  },
});

const QualityChip = styled(Box)({
  display: 'inline-flex',
  alignItems: 'center',
  gap: '0.5rem',
  padding: '4px 12px',
  borderRadius: '15px',
  background: 'rgba(255, 255, 255, 0.1)',
  color: 'white',
  fontSize: '0.875rem',
});

const DownloadOptions = ({ formats, onDownload }) => {
  if (!formats || formats.length === 0) return null;

  const filteredFormats = formats.filter(
    format => format.hasVideo && format.quality
  );

  return (
    <Box sx={{ mt: 4 }}>
      <Typography variant="h6" sx={{ mb: 2, color: 'white', fontWeight: 'bold' }}>
        اختر جودة التحميل المناسبة
      </Typography>

      <GlassTableContainer>
        <StyledTable>
          <TableHead>
            <TableRow>
              <TableCell>الجودة</TableCell>
              <TableCell>النوع</TableCell>
              <TableCell>حجم الملف</TableCell>
              <TableCell>الصوت</TableCell>
              <TableCell align="right">التحميل</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {filteredFormats.map((format) => (
              <TableRow key={format.itag}>
                <TableCell>
                  <QualityChip>
                    <HighQualityIcon sx={{ fontSize: 18, color: '#ff0000' }} />
                    {format.quality}
                  </QualityChip>
                </TableCell>
                <TableCell>
                  <QualityChip>
                    <MovieIcon sx={{ fontSize: 18, color: '#ff0000' }} />
                    {format.mimeType.split(';')[0]}
                  </QualityChip>
                </TableCell>
                <TableCell>
                  <QualityChip>
                    {formatFileSize(format.contentLength)}
                  </QualityChip>
                </TableCell>
                <TableCell>
                  <QualityChip>
                    <AudiotrackIcon sx={{ fontSize: 18, color: format.hasAudio ? '#ff0000' : 'gray' }} />
                    {format.hasAudio ? 'نعم' : 'لا'}
                  </QualityChip>
                </TableCell>
                <TableCell align="right">
                  <DownloadButton
                    variant="contained"
                    size="small"
                    startIcon={<DownloadIcon />}
                    onClick={() => onDownload(format.itag)}
                  >
                    تحميل
                  </DownloadButton>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </StyledTable>
      </GlassTableContainer>
    </Box>
  );
};

export default DownloadOptions;
